import chess.pgn

pgn = open("pgn_sample.txt")
game = chess.pgn.read_game(pgn)
board = game.board()
fen_list = []

for node in game.mainline():
    move = node.move
    eval = node.eval().white()

    board.push(move)
    fen_list.append((board.fen(), eval))

print(fen_list)